	function getData() {
		$.post("<?PHP echo base_url('index.php/show/getData')?>",null,function(data){
			console.log(data);
			 
			$('#last_cash').html(numberWithCommas(data.last));
			$('#sum_cash').html(numberWithCommas(data.sum));
			$('#all_cash').html(numberWithCommas(data.all));
			if(data.dis <= 0)
				$('#dis_cash').html("ยอดบริจาคครบแล้ว (+"+numberWithCommas(data.dis * (-1))+")");
			else 
				$('#dis_cash').html(numberWithCommas(data.dis));
		});
	}
	function numberWithCommas(x) {
    return x.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ",");
	}

</script>
